import logo from "./logo.svg";
import "./App.css";
import Hello from "./src/Hello";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <h1>Добро пожаловать в мой React-проект!</h1>{" "}
          <p>Это моё первое домашнее задание.</p>
        </div>
      </header>
      <Hello name="Laura" />
      <Hello name="Mike" />
      <Hello name="John" />
      <Hello name="Petra" />
    </div>
  );
}

export default App;
